css:
.editor-colors {
  background-color: #f4f4f4;
  color: #434a54;
}
.heading {
  color: #268bd2;
  font-weight: 900;
}
.editor .invisible-character,
.editor .indent-guide {
  color: #586e75;
}
.editor .gutter {
  background-color: #f4f4f4;
}
.editor .gutter .line-number {
  opacity: 0.2;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #d33682;
}
.editor .cursor {
  border-color: #268bd2;
}
.editor .selection .region {
  background-color: #268bd2;
  color: #f4f4f4;
}
.editor .line-number.cursor-line-no-selection {
  background-color: #f4f4f4;
}
.bracket-matcher {
  background-color: #93a1a1;
  opacity: 0.7;
}
.comment {
  color: #586e75;
  font-style: italic;
}
.entity {
  color: #e4402a;
}
.keyword {
  color: #859900;
}
.storage.type {
  color: #859900;
}
.constant {
  color: #b58900;
}
.constant.numeric,
.constant.boolean {
  color: #2aa198;
}
.variable {
  color: #268bd2;
}
.delimiter,
.brace {
  color: #e4402a;
}
.delimiter.period {
  color: #859900;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #e4402a;
}
.invalid.illegal {
  color: #e4402a;
}
.string {
  color: #2aa198;
}
.string .constant.character.escape {
  color: #e4402a;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #e4402a;
}
